import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './UpdateAnimalPage.css'; // Importa el archivo de estilos

const UpdateAnimalPage = () => {
    const [animalId, setAnimalId] = useState('');
    const [animalName, setAnimalName] = useState('');
    const [animalData, setAnimalData] = useState({
        name: '',
        species: '',
        birthDate: '',
        caretaker: '',
        habitat: ''
    });
    const [isEditing, setIsEditing] = useState(false);

    const navigate = useNavigate();

    const handleEdit = () => {
        if (!animalId && !animalName) {
            alert('Ingrese el ID o el nombre del animal para editar.');
            return;
        }

        // Aquí podrías realizar una búsqueda con el ID o el nombre
        setIsEditing(true); // Habilitamos la edición
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setAnimalData((prev) => ({ ...prev, [name]: value }));
    };

    const handleUpdate = () => {
        // Lógica para actualizar el animal
        console.log('Datos actualizados:', animalData);
        alert('Animal actualizado correctamente');
    };

    return (
        <div className="update-container">
            <h1 className="update-title">Actualizar Animal</h1>
            <form className="update-form">
                <div className="form-group">
                    <label htmlFor="animalId">ID del animal a actualizar:</label>
                    <input
                        type="text"
                        id="animalId"
                        value={animalId}
                        onChange={(e) => setAnimalId(e.target.value)}
                        disabled={isEditing}
                    />
                </div>

                <p style={{ textAlign: 'center', fontWeight: 'bold' }}>O</p>

                <div className="form-group">
                    <label htmlFor="animalName">Nombre del animal a actualizar:</label>
                    <input
                        type="text"
                        id="animalName"
                        value={animalName}
                        onChange={(e) => setAnimalName(e.target.value)}
                        disabled={isEditing}
                    />
                </div>

                <button
                    type="button"
                    className="edit-button"
                    onClick={handleEdit}
                    disabled={isEditing}
                >
                    Editar
                </button>

                <div className="form-group">
                    <label htmlFor="name">Nombre:</label>
                    <input
                        type="text"
                        id="name"
                        name="name"
                        value={animalData.name}
                        onChange={handleInputChange}
                        disabled={!isEditing}
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="species">Especie:</label>
                    <input
                        type="text"
                        id="species"
                        name="species"
                        value={animalData.species}
                        onChange={handleInputChange}
                        disabled={!isEditing}
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="birthDate">Fecha de Nacimiento:</label>
                    <input
                        type="date"
                        id="birthDate"
                        name="birthDate"
                        value={animalData.birthDate}
                        onChange={handleInputChange}
                        disabled={!isEditing}
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="caretaker">Cuidador:</label>
                    <input
                        type="text"
                        id="caretaker"
                        name="caretaker"
                        value={animalData.caretaker}
                        onChange={handleInputChange}
                        disabled={!isEditing}
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="habitat">Hábitat:</label>
                    <input
                        type="text"
                        id="habitat"
                        name="habitat"
                        value={animalData.habitat}
                        onChange={handleInputChange}
                        disabled={!isEditing}
                    />
                </div>
            </form>

            <div className="button-container">
                <button
                    type="button"
                    className="submit-button"
                    onClick={handleUpdate}
                    disabled={!isEditing}
                >
                    Actualizar
                </button>
                <button
                    type="button"
                    className="back-button"
                    onClick={() => navigate('/')}
                >
                    Atrás
                </button>
            </div>
        </div>
    );
};

export default UpdateAnimalPage;
